import {connect} from 'react-redux';

class HelloWorld extends Component {
    render() {
      return (
        <div>
            <h3>{message}</h3>
        </div>
      );
    }
  }

 const mapStateToProps = (state) => {
     return {
         message: state.message
     }
 }

  export default connect(mapStateToProps)(HelloWorld);
